public void setPrev(IntrusiveCollection<? extends Element> list, Element prev) {
  for (int i = 0; i < triplets.length; i += 3) {
    if (triplets[i] == list) {
      triplets[i + 1] = prev;
      return;
    }
  }
  throw new RuntimeException("Called setPrev on an element that wasn't " +
      "in the list.");
}
